def gcd_f(n, m):
    while m != 0:
        n, m = m, n % m
    return n

n = int(input())
t = list(map(int, input().split()))

gcd = t[0]
for i in range(1, n):
    gcd = gcd_f(gcd, t[i])

print(gcd)
